    def divide(self, dividend, divisor):
        if divisor == 0:
            return 2147483647
        result=0
        isNeg = False
        if (dividend>0 and divisor<0) or (dividend<0 and divisor>0):
            isNeg = True 
        dividend = abs(dividend)
        divisor = abs(divisor)

        digit=0
        while(divisor<=(dividend>>1)):
            divisor=divisor<<1
            digit+=1
        while digit>=0:
            if dividend>=divisor:
                dividend-=divisor
                result+=1<<digit
            divisor=divisor>>1
            digit-=1
        if isNeg:
            result=-result
        return result
    #Median of Two Sorted Arrays
    def findKth(self,A,astart,m,B,bstart,n,k):
        if m>n:
            return self.findKth(B,bstart,n,A,astart,m,k)
        if m==0:
            return B[bstart+k-1]
        if k==1:
            return min(A[astart],B[bstart])
        pa = min(k//2,m)
        pb = k-pa
        if A[astart+pa-1]<B[bstart+pb-1]:
            return self.findKth(A,astart+pa,m-pa,B,bstart,pb,k-pa)
        elif A[astart+pa-1]>B[bstart+pb-1]:
            return self.findKth(A,astart,pa,B,bstart+pb,n-pb,k-pb)
        else:
            return A[astart+pa-1]
    def findMedianSortedArrays(self, A, B):
        m = len(A)
        n = len(B)
        total = m+n
        if total%2==0:
            return (self.findKth(A,0,m,B,0,n,total//2)+self.findKth(A,0,m,B,0,n,total//2+1))/2.0
        else:
            return self.findKth(A,0,m,B,0,n,total//2+1)
    # Minimum Window Substring
    def minWindow(self, S, T):
        windowRecord = [0]*256
        targetRecord = [0]*256
        lens = len(S)
        lent = len(T)
        for i in range(lent):
            targetRecord[ord(T[i])]+=1
        minLength=lens+1
        begin = -1
        end = lens
        start=0
        found = 0
        for i in range(lens):
            if targetRecord[ord(S[i])]!=0:
                windowRecord[ord(S[i])]+=1
                if windowRecord[ord(S[i])]<=targetRecord[ord(S[i])]:
                    found+=1
                if found == lent:
                    while start<i:
                        if targetRecord[ord(S[start])]==0:
                            start+=1
                        else: 
                            windowRecord[ord(S[start])]-=1
                            if windowRecord[ord(S[start])]>=targetRecord[ord(S[start])]:
                                start+=1
                            else:
                               break
                    if i-start+1<minLength:
                        minLength = i-start+1
                        begin =start
                        end =i
                    found-=1
                    start+=1
        if begin ==-1:
            return ''
        else:
            return S[begin:end+1]
